Verenigde Staten
Sciencefiction / Thriller
84 minuten

goed

met Dane DeHaan, Alex Russell en Michael B. Jordan

Drie doodnormale middelbare scholieren doen een ongelooflijke ontdekking. Ze vinden in het bos een mysterieuze substantie waar 
ze aan bloot gesteld worden en waardoor ze superkrachten ontwikkelen. Als ze leren om de superkrachten onder controle te houden 
en ze te gebruiken in hun voordeel, beginnen hun levens uit de hand te lopen en hun duistere kanten naar boven te komen.
